import styled from 'styled-components';

function UserPopup() {
	return <ComponentWrapper>pop</ComponentWrapper>;
}

const ComponentWrapper = styled.div`
          height: 100%;
    padding: 0 5px;
    font-size: 14px;
    color: #333;
    font-weight: 600;
    line-height: 1;
}

.MenuPopover_menuContainer__vUynN {
    position: absolute;
    top: 100%;
    right: -27px;
    margin-top: 13px;
    padding: 0!important;
    display: block;
    -webkit-transform: translate(50%,8px);
    transform: translate(50%,8px);
}
`;

export default UserPopup;
